script: |
  super -f text -I q10688.spq | sort > q10688.out

inputs:
  - name: q10688.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE + col0 NOT BETWEEN - - col0 * - col1 + - - col0 / 11 + - + col0 AND + col1;
  - name: tab0

outputs:
  - name: q10688.out
    data: |
      87	21	10
      97	1	99
